import React from 'react';
import './App.css';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import HomePage from './HomePage'; // Importuj komponent HomePage
import Calendar from './Calendar';
import HourPicker from './HourPicker';
import RegistrationForm from './RegistrationForm'; // Importuj komponent rejestracji
import LoginForm from './LoginForm'; // Importuj komponent logowania

const App = () => {
  return (
    <Router>
      <div className="App">
        <nav>
          {/* Dodaj linki do rejestracji i logowania */}
          <Link to="/register">Rejestracja</Link>
          <Link to="/login">Logowanie</Link>
        </nav>
        <Routes>
          <Route path="/" element={<HomePage />} /> {/* Renderuj stronę główną */}
          <Route path="/calendar" element={<Calendar />} />
          <Route path="/hourpicker/:day" element={<HourPicker />} />
          {/* Dodaj trasy do formularza rejestracji i logowania */}
          <Route path="/register" element={<RegistrationForm />} />
          <Route path="/login" element={<LoginForm />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
